  display: flex;
  gap: 20px;
  align-items: flex-start;
  XXX: YYY;
`

const StyledAgreement = styled.div`
  padding: 50px;
  background-color: tomato;
  font-family: sans-serif;
  font-size: 20px;
  color: white;
  border-radius: 8px;
`

const CatComponent = () => {
    return (
        <StyledAnxiety>
            <StyledAgreement>Nikita</StyledAgreement>
            <StyledAgreement>Vladimir</StyledAgreement>
            <StyledAgreement>Leo</StyledAgreement>
        </StyledAnxiety>
    )
}

const root = ReactDOM.createRoot(document.getElementById('root') as HTMLElement);
root.render(
    <div className="App">
        <CatComponent />
    </div>
);


